function heatMapColorforValue(a,t){return 240*(1-a/t)}function hsl2rgb(a,t=100,n=50){var r,i,h,o,e,u;return isFinite(a)||(a=0),isFinite(t)||(t=0),isFinite(n)||(n=0),(a/=60)<0&&(a=6- -a%6),a%=6,t=Math.max(0,Math.min(1,t/100)),n=Math.max(0,Math.min(1,n/100)),u=(e=(1-Math.abs(2*n-1))*t)*(1-Math.abs(a%2-1)),a<1?(r=e,i=u,h=0):a<2?(r=u,i=e,h=0):a<3?(r=0,i=e,h=u):a<4?(r=0,i=u,h=e):a<5?(r=u,i=0,h=e):(r=e,i=0,h=u),o=n-e/2,"rgb("+[r=Math.round(255*(r+o)),i=Math.round(255*(i+o)),h=Math.round(255*(h+o))].join(", ")+")"}function rgbHeatMapValue(a,t){return hsl2rgb(heatMapColorforValue(a,t))}